package com.incloud.hcp.dto.mail;import java.util.List;public class ReenvioProveedor {    private List<Integer> proveedores;    private String cuerpo;    public ReenvioProveedor() {    }    public ReenvioProveedor(List<Integer> proveedores, String cuerpo) {        this.proveedores = proveedores;        this.cuerpo = cuerpo;    }    public List<Integer> getProveedores() {        return proveedores;    }    public void setProveedores(List<Integer> proveedores) {        this.proveedores = proveedores;    }    public String getCuerpo() {        return cuerpo;    }    public void setCuerpo(String cuerpo) {        this.cuerpo = cuerpo;    }}